import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import PostPage from './components/PostPage';
import NewPostForm from './components/NewPostForm';
import Header from './components/Header';
import Footer from './components/Footer';
import './App.css';

// Placeholder components for new sections
const FashionPage = () => <div className="page">Fashion Page</div>;
const BeautyPage = () => <div className="page">Beauty Page</div>;
const LifestylePage = () => <div className="page">Lifestyle Page</div>;
const PersonalEngagementPage = () => <div className="page">Personal Engagement Page</div>;

function App() {
  return (
    <Router>
      <div className="app">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/fashion" element={<FashionPage />} />
            <Route path="/beauty" element={<BeautyPage />} />
            <Route path="/lifestyle" element={<LifestylePage />} />
            <Route path="/personal-engagement" element={<PersonalEngagementPage />} />
            <Route path="/post/:id" element={<PostPage />} />
            <Route path="/new" element={<NewPostForm />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
